NEWBIE_TOOLTIP_HONORABLE_KILLS = "Que vous soyez seul ou en groupe, lorsque vous êtes en mode JcJ, à chaque fois que vous infligez des dégâts à un ennemi et que celui-ci est tué, vous remportez une victoire honorable. Attention, ce n’est vrai que si la cible est verte ou mieux (comme s’il s’agissait d’un monstre qui devait vous rapporter de l’expérience). Seuls les personnages-joueurs ennemis peuvent rapporter des victoires honorables.";
NEWBIE_TOOLTIP_HONOR_CONTRIBUTION_POINTS = "L’honneur est ce que vous gagnez lorsque vous obtenez des victoires honorables en combat JcJ. La quantité d’honneur obtenue dépend des dégâts infligés à la victime, que vous ayez été seul ou en groupe. Plus vous infligez de dégâts, plus vous gagnez d’honneur. Ce gain d’honneur est divisé entre les membres de votre groupe ou de votre groupe de raid. Attention, tuer le même personnage encore et encore au cours d’une brève période vous rapporte de moins en moins d’honneur. Au bout d’un moment, il ne vous rapporte plus que quelques points, voire rien du tout.";
NEWBIE_TOOLTIP_HONOR_STANDING = "La position de votre personnage est relative, calculée par rapport à tous les autres personnages-joueurs de votre faction, Horde ou Alliance. Ainsi, si elle est de 150, 149 personnages ont gagné plus d’Honneur que le vôtre au cours de cette période. Il faut obtenir au moins 25 Victoires honorables en une semaine pour être éligible à un grade ou à une position.";
